const now = new Date();
//first message will expire in 15s, all subsequent in 3s
const firstExpire = now.getTime() + 5000;
var incrementCounter = 1;

// Each message will expire in 30 sec, after previous.
// I made it just a number because for this demo I'm not bothering with timezone and stuff
messages.forEach(function (message) {
  message.expires = firstExpire + incrementCounter * 2000;
  incrementCounter++;
});

export default messages;
